Properties.Header:
{% assign results = Workflow | Attribute:'Response' | FromJSON %}
{% for photo in results.artifacts %}
  <img src="data:image/png;base64,{{ photo.base64}}" />
{% endfor %}

Properties.Value:
{%- assign token = 'REPLACE THIS WITH API TOKEN' -%}
{%- assign style = Workflow | Attribute:'Style','RawValue' -%}
{% capture output %}{
  "cfg_scale": 7,
  "clip_guidance_preset": "FAST_BLUE",
  "height": {{ Workflow | Attribute:'AspectRatio','RawValue' | Split:'x' | Last }},
  "width": {{ Workflow | Attribute:'AspectRatio','RawValue' | Split:'x' | First }},
  "samples": {{ Workflow | Attribute:'Samples' }},
  "steps": 75,
  {% if style != null and style != empty%}"style_preset": "{{ style }}",{% endif %}
  "text_prompts": [
    {
      "text": "{{ Workflow | Attribute:'Prompt' }}",
      "weight": 1
    }
  ]
}{% endcapture %}
{%- assign bodyoutput = output | Trim | StripNewLines -%}
{%- webrequest url:'https://api.stability.ai/v1/generation/stable-diffusion-xl-1024-v0-9/text-to-image' body:'{{bodyoutput}}'  headers:'Authorization^Bearer {{token}}|Accept^application/json' method:'POST' requestcontenttype:'application/json' timeout:'120000'  -%}
   {{- results | ToJSON -}}
{%- endwebrequest -%}

